scripts.komputeintegration_autonomousbattle_init:
var pool = ROYGBIV.createVectorPool(20);

var states = {
  "MOVE_RANDOMLY": "MOVE_RANDOMLY",
  "COMBAT": "COMBAT",
  "AGGRESSIVE": "AGGRESSIVE"
};

var NORM_VECT = ROYGBIV.vector(0, 0, 1);
var NORM_VECT2 = ROYGBIV.vector(0, 1, 0);

var Character = function(body, enemyBody, weapon, psPool, expPool, behaviorName, statusText, botName){
  this.state = states.MOVE_RANDOMLY;

  this.body = body;
  this.enemyBody = enemyBody;
  this.weaponObj = weapon;

  this.statusText = statusText;
  this.botName = botName;

  this.initialPos = ROYGBIV.getPosition(body, ROYGBIV.vector());

  this.behaviorName = behaviorName;

  this.onIntersectionTestCompleted = this.onIntersectionTestCompleted.bind(this);

  this.lastCombatMoveTime = 0;
  this.lastShootTime = 0;

  this.health = 20;

  this.psPool = psPool;
  this.expPsPool = expPool;
  var psStartParametersByPsName = {};
  var explosionPSStarParametersByPsName = {};
  if (psPool){
    ROYGBIV.executeForEachParticleSystem(psPool, function(ps, psName){
      psStartParametersByPsName[psName] = {
        particleSystem: ps,
        startPosition: ROYGBIV.vector(),
        startVelocity: ROYGBIV.vector(),
        startQuaternion: ROYGBIV.quaternion()
      };

      ROYGBIV.setCollisionListener(ps, function(collisionInfo){
        ROYGBIV.stopParticleSystem(ps, 0);

        var objName = collisionInfo.targetObjectName;
        var char = ROYGBIV.globals.objChars[objName];
        if (char){
          char.onHit();
        }

        if (expPool){
          var expPs = ROYGBIV.getParticleSystemFromPool(expPool);

          if (!expPs){
            return;
          }

          var confs = explosionPSStarParametersByPsName[expPs.name];

          var tmpVec = ROYGBIV.getFromVectorPool(pool);
          ROYGBIV.setVector(tmpVec, collisionInfo.faceNormalX, collisionInfo.faceNormalY, collisionInfo.faceNormalZ);
          ROYGBIV.computeQuaternionFromVectors(NORM_VECT2, tmpVec, confs.startQuaternion);

          ROYGBIV.setVector(confs.startPosition, collisionInfo.x, collisionInfo.y, collisionInfo.z);
          ROYGBIV.startParticleSystem(confs);
        }
      });
    });
    this.psStartParametersByPsName = psStartParametersByPsName;
  }

  if(expPool){
    ROYGBIV.executeForEachParticleSystem(expPool, function(ps, psName){
      explosionPSStarParametersByPsName[psName] = {
        particleSystem: ps,
        startPosition: ROYGBIV.vector(),
        startQuaternion: ROYGBIV.quaternion()
      };
    });
  }
}

Character.prototype.onHit = function(){
  this.health --;

  var text = this.botName + "  ";
  for (var i = 0; i < this.health; i ++){
    text += "█";
  }

  if (this.health == 0){
    text += "dead";
  }

  ROYGBIV.setText(this.statusText, text);

  if (this.health <= 10){
    ROYGBIV.setTextColor(this.statusText, "#fabd2f");
  }

  if (this.health <= 5){
    ROYGBIV.setTextColor(this.statusText, "#fb4934");
  }

  if (this.health == 0){
    ROYGBIV.globals.onNewRound(this.body.name);
  }
}

Character.prototype.canSeeEnemy = function(){

  this.lastSeeTime = performance.now();

  if (this.state == states.MOVE_RANDOMLY){
    this.state = states.COMBAT;
    ROYGBIV.stopSteerable(this.body);
    ROYGBIV.setSteeringBehavior(this.body, "blendedAttack");
  }

  if (this.state == states.COMBAT || this.state == states.AGGRESSIVE){
    var enemyPos = ROYGBIV.getFromVectorPool(pool);
    ROYGBIV.getPosition(this.enemyBody, enemyPos);
    ROYGBIV.setSteerableLookTarget(this.body, enemyPos);

    var now = performance.now();
    if (now - this.lastShootTime > 150 && this.psPool){
      var ps = ROYGBIV.getParticleSystemFromPool(this.psPool);
      if (!ps){
        return;
      }

      var startConfs = this.psStartParametersByPsName[ps.name];

      ROYGBIV.getEndPoint(this.weaponObj, ROYGBIV.endpoints.PLUS_X, startConfs.startPosition);

      var v1 = ROYGBIV.getFromVectorPool(pool);
      var sp = startConfs.startPosition;
      ROYGBIV.setVector(v1, enemyPos.x - sp.x, enemyPos.y - sp.y, enemyPos.z - sp.z);
      ROYGBIV.computeQuaternionFromVectors(NORM_VECT, v1, startConfs.startQuaternion);

      ROYGBIV.multiplyScalar(v1, 3000, startConfs.startVelocity);

      ROYGBIV.startParticleSystem(startConfs);

      this.lastShootTime = now;
    }
  }
}

Character.prototype.cantSeeEnemy = function(){
  if (this.state == states.COMBAT){
    var now = performance.now();
    if (now - this.lastSeeTime > 4000){
      this.state = states.AGGRESSIVE;
      this.lastCombatMoveTime = 0;
    }
  }
}

Character.prototype.onIntersectionTestCompleted = function(x, y, z, objName){
  if (!objName){
    return;
  }

  var obj = ROYGBIV.getObject(objName);

  if (!obj){
    return;
  }

  var lookDirectionVector = ROYGBIV.getFromVectorPool(pool);
  ROYGBIV.getSteerableLookDirection(this.body, lookDirectionVector);

  var dir = ROYGBIV.getFromVectorPool(pool);
  ROYGBIV.getPosition(this.body, dir);
  ROYGBIV.setVector(dir, x - dir.x, y - dir.y, z - dir.z);
  ROYGBIV.normalizeVector(dir);

  var x1 = lookDirectionVector.x;
  var y1 = lookDirectionVector.z;
  var x2 = dir.x;
  var y2 = dir.z;

  var dot = (x1 * x2) + (y1 * y2);
  var det = (x1 * y2) - (y1 * x2);
  var radianDiff = Math.atan2(det, dot);

  if (obj === this.enemyBody && radianDiff <= Math.PI/2){
    this.canSeeEnemy();
  }else{
    this.cantSeeEnemy();
  }
}

Character.prototype.update = function(x, y, z){
  var fromVector = ROYGBIV.getFromVectorPool(pool);
  var toVector = ROYGBIV.getFromVectorPool(pool);
  var dirVector = ROYGBIV.getFromVectorPool(pool);

  ROYGBIV.setVector(fromVector, x, y, z);
  ROYGBIV.getPosition(this.enemyBody, toVector);

  ROYGBIV.sub(toVector, fromVector, dirVector);
  ROYGBIV.normalizeVector(dirVector);
  ROYGBIV.multiplyScalar(dirVector, 105, dirVector);

  ROYGBIV.setVector(fromVector, x + dirVector.x, y + dirVector.y, z + dirVector.z);

  ROYGBIV.intersectionTest(fromVector, dirVector, this.onIntersectionTestCompleted);

  var now = performance.now();
  if (this.state == states.COMBAT && now - this.lastCombatMoveTime > 2500){
    x += 4000 * (Math.random() - 0.5);
    z += 4000 * (Math.random() - 0.5);
    var randomVec = ROYGBIV.getFromVectorPool(pool);
    ROYGBIV.setVector(randomVec, x, y, z);
    ROYGBIV.setSteerableTargetPosition(this.body, randomVec);
    this.lastCombatMoveTime = now;
  }

  if (this.state == states.AGGRESSIVE && now - this.lastCombatMoveTime > 2500){
    var vec = ROYGBIV.getFromVectorPool(pool);
    ROYGBIV.getPosition(this.enemyBody, vec);
    vec.x += 4000 * (Math.random() - 0.5);
    vec.z += 4000 * (Math.random() - 0.5);
    ROYGBIV.setSteerableTargetPosition(this.body, vec);
    this.lastCombatMoveTime = now;
  }
}

var onScene1Entry = function(){
  var steerable1 = ROYGBIV.getObject("steerable1");
  var steerable2 = ROYGBIV.getObject("steerable2");
  var weapon1 = ROYGBIV.getObject("weapon1");
  var weapon2 = ROYGBIV.getObject("weapon2");

  steerable1.mesh.renderOrder = 9000;
  steerable2.mesh.renderOrder = 9000;
  weapon1.mesh.renderOrder = 9000;
  weapon2.mesh.renderOrder = 9000;

  ROYGBIV.show(steerable1);
  ROYGBIV.show(steerable2);
  ROYGBIV.show(weapon1);
  ROYGBIV.show(weapon2);

  var steerable1InitialPos = ROYGBIV.getMarkedPosition("p1_initial_position", ROYGBIV.vector());
  var steerable2InitialPos = ROYGBIV.getMarkedPosition("p2_initial_position", ROYGBIV.vector());

  ROYGBIV.resetObjectRotation(steerable1);
  ROYGBIV.resetObjectRotation(steerable2);
  ROYGBIV.resetObjectRotation(weapon1);
  ROYGBIV.resetObjectRotation(weapon2);

  var weapon1Pool = ROYGBIV.getParticleSystemPool("weapon1Pool");
  var weapon2Pool = ROYGBIV.getParticleSystemPool("laserPool2");
  var explosion1Pool = ROYGBIV.getParticleSystemPool("expPool1");
  var explosion2Pool = ROYGBIV.getParticleSystemPool("expPool2");

  var statusText1 = ROYGBIV.getText("bot1Status");
  var statusText2 = ROYGBIV.getText("bot2Status");

  var bot1Text = ROYGBIV.getText("bot1Text");
  var bot2Text = ROYGBIV.getText("bot2Text");

  ROYGBIV.showText(bot1Text);
  ROYGBIV.showText(bot2Text);

  ROYGBIV.setTextColor(statusText1, "#b8bb26");
  ROYGBIV.setTextColor(statusText2, "#b8bb26");

  ROYGBIV.setText(statusText1, "bot1  ████████████████████");
  ROYGBIV.setText(statusText2, "bot2  ████████████████████");

  var githubText = ROYGBIV.getText("githubTetx");
  ROYGBIV.setTextColor(githubText, "#fabd2f")
  ROYGBIV.onTextMouseOver(githubText, function(){
    ROYGBIV.setTextColor(githubText, "#83a598");
  });
  ROYGBIV.onTextMouseOut(githubText, function(){
    ROYGBIV.setTextColor(githubText, "#fabd2f");
  });
  ROYGBIV.onTextClick(githubText, function(){
    window.location.assign("https://github.com/oguzeroglu/ROYGBIV", "_blank");
  });

  ROYGBIV.setPosition(steerable1, steerable1InitialPos.x, steerable1InitialPos.y, steerable1InitialPos.z);
  ROYGBIV.setPosition(steerable2, steerable2InitialPos.x, steerable2InitialPos.y, steerable2InitialPos.z);

  var character1 = new Character(steerable1, steerable2, weapon1, weapon1Pool, explosion1Pool, "blended1", statusText1, "bot1");
  var character2 = new Character(steerable2, steerable1, weapon2, weapon2Pool, explosion2Pool, "blended2", statusText2, "bot2");
  var characters = [character1, character2];
  ROYGBIV.globals.objChars = {
    steerable1: character1,
    steerable2: character2
  };

  ROYGBIV.setActiveControl(ROYGBIV.createOrbitControl({
    maxRadius: 2500,
    minRadius: 400,
    zoomDelta: 10
  }));

  var boxDirectionVector1 = ROYGBIV.vector(1, 0, 0);
  var boxDirectionVector2 = ROYGBIV.vector(1, 0, 0);
  ROYGBIV.setPositionChangeListener(steerable1, function(x, y, z){
    adjustWeaponPosition(steerable1, weapon1, x, y, z, boxDirectionVector1);
    characters[0].update(x, y, z);
    ROYGBIV.setTextPosition(bot1Text, x, 350, z);
    //ROYGBIV.setText(githubText, ROYGBIV.getFPS() + " - " + fpsHandler.roygbivScore.score);
  });

  ROYGBIV.setPositionChangeListener(steerable2, function(x, y, z){
    adjustWeaponPosition(steerable2, weapon2, x, y, z, boxDirectionVector2);
    characters[1].update(x, y, z);
    ROYGBIV.setTextPosition(bot2Text, x, 350, z);
  });


  ROYGBIV.globals.onNewRound = function(killedSteerableName){
    ROYGBIV.stopDelayedExecution(ROYGBIV.globals.delayedExecutionID);
    ROYGBIV.stopAnimation(infoText, "anim1");
    var winnerName = killedSteerableName == "steerable1"? "bot2": "bot1";
    ROYGBIV.setText(infoText, winnerName + " wins this round.");
    ROYGBIV.startAllAnimations(infoText);

    var timer = 3;
    ROYGBIV.globals.delayedExecutionID = ROYGBIV.executeDelayed(function(){
      ROYGBIV.globals.delayedExecutionID = ROYGBIV.executeDelayed(function(){
        if (timer == 0){
          ROYGBIV.stopDelayedExecution(ROYGBIV.globals.delayedExecutionID);
          onScene1Entry();
          return;
        }
        ROYGBIV.setText(infoText, "New round in: " + timer);
        timer --;
      }, 1000, true);
    }, 3000, false);

    var killedObj = ROYGBIV.getObject(killedSteerableName);
    var winnerObj = ROYGBIV.getObject(killedSteerableName == "steerable1"? "steerable2": "steerable1");

    characters[0].state = states.MOVE_RANDOMLY;
    characters[1].state = states.MOVE_RANDOMLY;

    ROYGBIV.hide(killedObj);

    if (killedObj === steerable1){
      ROYGBIV.hide(weapon1);
    }else{
      ROYGBIV.hide(weapon2);
    }

    ROYGBIV.resetRandomPathBehavior(winnerObj, killedSteerableName == "steerable1"? "blended2": "blended1");
    ROYGBIV.setSteeringBehavior(winnerObj, killedSteerableName == "steerable1"? "blended2": "blended1");
  }

  ROYGBIV.resetRandomPathBehavior(steerable1, "blended1");
  ROYGBIV.resetRandomPathBehavior(steerable2, "blended2");
  ROYGBIV.setSteeringBehavior(steerable1, "blended1");
  ROYGBIV.setSteeringBehavior(steerable2, "blended2");

  var infoText = ROYGBIV.getText("infoText");
  var texts = ROYGBIV.isMobile()? [
    "bots are programmed to attack each other on sight",
    "pinch to zoom in/out",
    "move finger to rotate"
  ]:[
    "bots are programmed to attack each other on sight",
    "w/s to zoom in/out",
    "a/d to rotate",
    "scroll touchpad/drag mouse to rotate"
  ];

  var textIndex = 1;
  ROYGBIV.setText(infoText, texts[0]);
  ROYGBIV.startAllAnimations(infoText);
  ROYGBIV.globals.delayedExecutionID = ROYGBIV.executeDelayed(function(){
    ROYGBIV.setText(infoText, texts[textIndex ++]);
    ROYGBIV.startAllAnimations(infoText);
    if (textIndex == texts.length){
      textIndex = 0;
    }
  }, 3000, true);

  ROYGBIV.onSceneExit("scene1", function(){
    ROYGBIV.stopDelayedExecution(ROYGBIV.globals.delayedExecutionID);
  });
};

var onSceneRotateDeviceEntry = function(){

  ROYGBIV.startAllAnimations(ROYGBIV.getSprite("spriteRotateDevice"));

  var infos = [
    "rotate device",
    "make sure auto-rotate is enabled"
  ];

  var ctr = 1;

  var infoText = ROYGBIV.getText("rotateDeviceInfoText");

  ROYGBIV.setText(infoText, infos[0]);
  ROYGBIV.startAllAnimations(infoText);

  var executionID = ROYGBIV.executeDelayed(function(){
    ROYGBIV.setText(infoText, infos[ctr ++]);
    ROYGBIV.startAllAnimations(infoText);

    if (ctr == infos.length){
      ctr = 0;
    }
  }, 3000, true);

  ROYGBIV.onSceneExit("rotateDevice", function(){
    ROYGBIV.stopDelayedExecution(executionID);
  });
}

var LOOK_RADIUS = 500;
var adjustWeaponPosition = function(steerableObj, weaponObj, x, y, z, boxDirectionVector){
  var positionVector = ROYGBIV.getFromVectorPool(pool);
  ROYGBIV.setVector(positionVector, x, 100, z);

  var lookDirectionVector = ROYGBIV.getFromVectorPool(pool);
  ROYGBIV.getSteerableLookDirection(steerableObj, lookDirectionVector);

  var limitVector = ROYGBIV.getFromVectorPool(pool);
  ROYGBIV.multiplyScalar(lookDirectionVector, LOOK_RADIUS, limitVector);
  ROYGBIV.add(limitVector, positionVector, limitVector);

  var centerVector = ROYGBIV.getFromVectorPool(pool);
  ROYGBIV.setVector(centerVector, (positionVector.x + limitVector.x) / 2, 100, (positionVector.z + limitVector.z) / 2);

  ROYGBIV.setPosition(weaponObj, centerVector.x, centerVector.y, centerVector.z);

  var x1 = lookDirectionVector.x;
  var y1 = lookDirectionVector.z;
  var x2 = boxDirectionVector.x;
  var y2 = boxDirectionVector.z;

  var dot = (x1 * x2) + (y1 * y2);
  var det = (x1 * y2) - (y1 * x2);
  var radianDiff = Math.atan2(det, dot);

  ROYGBIV.rotate(weaponObj, ROYGBIV.axes.Y, radianDiff);
  ROYGBIV.setVector(boxDirectionVector, lookDirectionVector.x, lookDirectionVector.y, lookDirectionVector.z);

  ROYGBIV.translate(weaponObj, ROYGBIV.axes.X, -170);
  ROYGBIV.translate(weaponObj, ROYGBIV.axes.Z, -140);
}

if (!ROYGBIV.isMobile() || ROYGBIV.isOrientationLandscape()){
  onScene1Entry();
}else{
  ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
}

if (ROYGBIV.isMobile()){
  ROYGBIV.setScreenOrientationChangeListener(function(isLandscape){
    if (isLandscape){
      ROYGBIV.changeScene("scene1", onScene1Entry);
    }else{
      ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
    }
  });
}

ROYGBIV.stopScript("kompute-integration_autonomous-battle_init");
